import React, { useState } from 'react';

const BookingForm = ({ onSubmit }) => {
  const [formData, setFormData] = useState({ name: '', vehicle: '', duration: '' });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit(formData);
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2 className="text-center">Formulir Pemesanan</h2>
      <div className="mb-3">
        <label className="form-label">Nama</label>
        <input
          type="text"
          name="name"
          className="form-control"
          placeholder="Nama"
          onChange={handleChange}
          required
        />
      </div>
      <div className="mb-3">
        <label className="form-label">Nomor Kendaraan</label>
        <input
          type="text"
          name="vehicle"
          className="form-control"
          placeholder="Nomor Kendaraan"
          onChange={handleChange}
          required
        />
      </div>
      <div className="mb-3">
        <label className="form-label">Durasi (jam)</label>
        <input
          type="number"
          name="duration"
          className="form-control"
          placeholder="Durasi (jam)"
          onChange={handleChange}
          required
        />
      </div>
      <button type="submit" className="btn btn-primary w-100">
        Pesan Tempat
      </button>
    </form>
  );
};

export default BookingForm;
